int inv(int a,int p) {
	int x,y;exgcd(a,p,x,y);
	return (x+p)%p;
}

struct dat {
	int x,y,cnt;
} st[110];

void get(int c,int d) {
	tp=0;int a=1,b=0;
	while(d) {
		++tp;st[tp]=(dat){st[tp-1].x+c/d*a,st[tp-1].y+c/d*d,c/d};
		for(int t=0;t<2&&d;t++) {
			if(!t) b+=c/d*a; else a+=c/d*b;
			swap(c,d);d%=c;
		}
	}
}

