			if(c.first==0) ret=max(ret,Y/c.second);
			else if(c.second==0) ret=max(ret,X/c.first);
			else ret=max(ret,min(X/c.first,Y/c.second));
		}
		FOR(i,cand.size()-1) {
			ll AX=cand[i].first,AY=cand[i].second;
			ll BX=cand[i+1].first,BY=cand[i+1].second;
			if(AY*X<=AX*Y || BY*X>=BX*Y) continue;
			ll step=__gcd(BX-AX,AY-BY);
			ll dx=(BX-AX)/step;
			ll dy=(BY-AY)/step;

			int cur=0;
			for(j=29;j>=0;j--) if(cur+(1<<j)<step) {
				ll CX=AX+(cur+(1<<j))*dx;
				ll CY=AY+(cur+(1<<j))*dy;
				if(CY*X>CX*Y) cur+=1<<j;
			}
			ll TX=AX+cur*dx;
			ll TY=AY+cur*dy;
			ll SX=TX+dx;
			ll SY=TY+dy;
			ll mx=0;
			for(j=29;j>=0;j--) {
				ll lef=(-SX*(mx+(1<<j))+X)*TY;
				ll ri=(-TX*(mx+(1<<j))+Y)*SY;
				if(lef>ri) mx+=1<<j;
			}
			ret=max(ret,min(X/TX,Y/TY));
			ret=max(ret,min(X/SX,Y/SY));
			//cout<<i<<":: "<<SX<<" "<<SY<<" "<<TX<<" "<<TY<<" "<<X<<" "<<Y<<" "<<mx<<" "<<ret<<endl;
			for(x=mx-1;x<=mx+1;x++) if(x>=0) {
				ll LX=X-SX*x;
				ll LY=Y-SY*x;
				if(LX>=0&LY>=0) ret=max(ret,x+min(LX/TX,LY/TY));
			}
			//cout<<ret<<endl;
			FOR(x,1000000) {
				ll LX=X-SX*x;
				ll LY=Y-SY*x;
				if(LX<0 || LY<0) break;
				ret=max(ret,x+min(LX/TX,LY/TY));
			}
			//cout<<ret<<endl;

		}

		cout<<ret<<endl;


	}
}


