		g=__gcd(A,C);	A/=g;	C/=g;	g2=gcd(B,g);	B/=g2;	Y/=g/g2;
		g=__gcd(B,C);	B/=g;	C/=g;	g2=gcd(A,g);	A/=g2;	X/=g/g2;
		if(C==1) {
			cout<<X+Y<<endl;
