		}
		A%=C;
		B%=C;

		TC=totient(C);

		vector<pair<ll,ll>> cand;
		ll D=A*modpow(B,TC-1,C)%C;
		cand.push_back({0,C});
		ll H=D,W=0;
		while(1) {
			H%=(C-W);
			if(H==0) break;
			ll dif=(C-W)%H;
			if(dif==0) break;
			W=C-dif;
			ll X=W*modpow(D,TC-1,C)%C;
			ll Y=(C-D*X%C)%C;
			cand.push_back({X,Y});
		}
		cand.push_back({C,0});

		ll ret=0;
		//cout<<A<<" "<<X<<" "<<B<<" "<<Y<<" "<<C<<endl;
		FORR(c,cand) {
			//cout<<c.first<<" "<<c.second<<endl;
			if(c.first==0) ret=max(ret,Y/c.second);
			else if(c.second==0) ret=max(ret,X/c.first);
			else ret=max(ret,min(X/c.first,Y/c.second));
		}
		FOR(i,cand.size()-1) {
