/**
 * Description: euclid finds ${x,y}$ such that $ax+by=\gcd(a,b)$ 
 	* and $|ax|,|by|\le \frac{ab}{\gcd(a,b)}.$ Should work for $a,b<2^{62}$
 * Source: KACTL
 * Time: O(\log ab)
 */

pl euclid(ll a, ll b) { 
	if (!b) return {1,0};
	pl p = euclid(b,a%b); return {p.s,p.f-a/b*p.s}; }
ll invGen(ll a, ll b) { 
	pl p = euclid(a,b); assert(p.f*a+p.s*b == 1); // gcd is 1
	return p.f+(p.f<0)*b; }

/**
 * Description: finds smallest $x\ge 0$ such that $L\le Ax\pmod{P}\le R$
 * Source: https://codeforces.com/gym/102411/submission/64315879
 * Verification: https://codeforces.com/gym/102411/problem/G
 */

ll cdiv(ll x, ll y) { return (x+y-1)/y; }
ll bet(ll P, ll A, ll L, ll R) { 
	if (A == 0) return L == 0 ? 0 : -1;
	ll c = cdiv(L,A); if (A*c <= R) return c;
	ll B = P%A; // P = k*A+B, L <= A(x-Ky)-By <= R 
	// => -R <= By % A <= -L
	auto y = bet(A,B,A-R%A,A-L%A); 
	return y == -1 ? y : cdiv(L+B*y,A)+P/A*y;
}


ll A,X,B,Y,C;
int solve() {
	re(A,X,B,Y,C);
	ll g = __gcd(A,B);
	A /= g, B /= g; C /= __gcd(g,C);
	F0R(i,2) {
		int t = __gcd(A,C);
		Y /= t; A /= t, C /= t;
		swap(A,B); swap(X,Y);
	}
	assert(__gcd(A,B) == 1 && __gcd(B,C) == 1 && __gcd(C,A) == 1);
	dbg("OK",A,B,C,X,Y);
	if (C == 1) return X+Y;
	vpi posi; posi.pb({0,C});
	int con = -1LL*A*invGen(B,C)%C; con = (con+C)%C;
	while (posi.bk.s) {
		pi a = posi.bk;
		int L = 1, R = a.s-1; if (L > R) break;
		ll x = bet(C,con,L,R); if (x == -1) break;
		pi b = {x,con*x%C};
		int ti = a.s/(a.s-b.s); if (a.s%(a.s-b.s) == 0) ti --;
		pi c = {a.f+ti*(b.f-a.f),a.s+ti*(b.s-a.s)}; assert(c.s > 0 && c.s <= a.s-b.s);
		posi.pb(c);
		// int rem = con*x%C;
		// int dem = C-con;
		// int times = rem/dem-(rem%dem == 0);
		// posi.pb({{x,}});
		// dbg("HAHA",posi.bk);
		// 0 < (-A*x)*B^{-1} < posi.bk.s mod C
	}
	assert(posi.bk.s < C);
	posi.pb({C,0});
	ll ans = 0;
	F0R(i,sz(posi)-1) {
		pi a = posi[i], b = posi[i+1];
		int g = __gcd(b.f-a.f,a.s-b.s);
		pi d = {(b.f-a.f)/g,(a.s-b.s)/g}; assert(d.f > 0 && d.s > 0);
		auto ok = [&](ll mid) -> bool {
			if (a.f*mid > X || b.s*mid > Y) return 0;
			ll L = 0, R = g*mid;
			if (b.f*mid > X) ckmin(R,(X-a.f*mid)/d.f);
			if (a.s*mid > Y) ckmax(L,cdiv(a.s*mid-Y,d.s));
			return L <= R;
		};
		ll lo = 0, hi = X+Y;
		while (lo < hi) {
			ll mid = (lo+hi+1)/2;
			if (ok(mid)) lo = mid;
			else hi = mid-1;
		}
		ckmax(ans,lo);
	}
	return ans;
}

