void eukl(ll &x, ll &y, ll a, ll b) {
	if (!a) { x = 0; y = 1; return; }
	eukl(y, x, b % a, a);
	x -= y * (b / a);
}

ll odw(ll v)
{
	ll x, y;
	eukl(x, y, v, c);
	x%=c;
	x+=c;
	x%=c;
	return x;
}

void relax()
{
	ll g=__gcd(a, b);
	g=__gcd(g, c);
	a/=g;
	b/=g;
	c/=g;

	g=__gcd(a, b);
	a/=g;
	b/=g;

	g=__gcd(a, c);
	a/=g;
	c/=g;
	y/=g;

	g=__gcd(b, c);
	b/=g;
	c/=g;
	x/=g;
}

vector<pll> sta;
vector<pll> dod;
vll razy;
ll jest;

pll dajkt(int v, ll x)
{
	return {sta[v].first+x*dod[v].first, sta[v].second+x*dod[v].second};
}

pll daj(ll x)
{
	int v=0;
	while(razy[v]<=x)
	{
		x-=razy[v];
		v++;
	}
	return dajkt(v, x);
}

void euklides()
{
	ll mno=odw(b)*a;
	mno%=c;
	mno=c-mno;
	mno%=c;

	sta.clear();
	dod.clear();
	razy.clear();
	ll mini=1;
	ll maxi=1;
	ll wmi=mno;
	ll wma=mno;
	sta.push_back({0, c});
	dod.push_back({0, 0});
	razy.push_back(1);
	sta.push_back({1, mno});
	dod.push_back({0, 0});
	razy.push_back(1);
	while(mini+maxi<=c)
	{
		if ((wmi+wma)%c<wmi)
		{
			ll ile=wmi/(c-wma);
			sta.push_back({mini+maxi, (wmi+wma)%c});
			dod.push_back({maxi, wma-c});
			razy.push_back(ile);
			mini+=ile*maxi;
			wmi+=ile*wma;
			wmi%=c;
		}
		else
		{
			ll ile=(c-wma-1)/wmi;
			maxi+=ile*mini;
			wma+=ile*wmi;
			wma%=c;
		}
	}
	jest=0;
	for (ll i : razy)
		jest+=i;
}

int check(ll v)
{
	ll bsa=0;
	ll bsb=jest-1;
	while(bsa<bsb)
	{
		ll bss=(bsa+bsb+2)>>1;
		if (daj(bss).first*v<=x)
			bsa=bss;
		else
			bsb=bss-1;
	}
	ll g=bsa;
	if (g==jest-1)
		return 1;
	pll lew=daj(g);
	pll pra=daj(g+1);
	bsa=0;
	bsb=v;
	while(bsa<bsb)
	{
		ll bss=(bsa+bsb+2)>>1;
		if (bss*pra.first+(v-bss)*lew.first<=x)
			bsa=bss;
		else
			bsb=bss-1;
	}
	return (bsa*pra.second+(v-bsa)*lew.second<=y);
}

