void init() {
	int d=gcd(A,B);
	A/=d,B/=d,C/=gcd(d,C);
	for(int _=0;_<2;++_) {
		d=gcd(A,C);
		C/=d,A/=d;
		int t=gcd(B,d);
		B/=t,Y/=d/t;
		swap(A,B),swap(X,Y);
	}
}
void getpos() {
	pos.clear(),cnt.clear();
	int W=C,H=D,now=0,r=inver(D,C);
	while(W) {
		int d=W/H;
		pos.push_back((ll)now*r%C),cnt.push_back(d); 
		now+=d*H;
		W%=H; if(W==0) break;
		H%=W; if(H==0) H=W;
	}
	pos.push_back(C);
}
inline int gety(int x) {return C-(ll)x*D%C;}
