void slv(){
	int a,x,b,y,c;
	cin>>a>>x>>b>>y>>c;
	{
		int g=gcd(a,b);
		a/=g;
		b/=g;
		c/=gcd(g,c);
	}
	rep(_,2){
		int g=gcd(a,c);
		a/=g;
		c/=g;
		int h=gcd(b,g);
		b/=h;
		y/=g/h;

		swap(a,b);
		swap(x,y);
	}
	if(c==1){
		print(x+y);
		return;
	}
	int step=modinv(b,c).b*a%c;
	vi pos,cnt;
	{
		int z=modinv(step,c).b;
		int h=step;
		int w=c;
		int cur=0;
		while(w){
			int p=w/h;
			pos.pb(cur*z%c);
			cnt.pb(p);
			cur+=p*h;
			w%=h;
			if(w==0)break;
			h%=w;
			if(h==0)h=w;
		}
		assert(cur==c);
		pos.pb(c);
	}
	auto gety=[&](int v){
		if(v==0)return c;
		return (c-step*v%c)%c;
	};
	int ans=0;
	rep(i,si(cnt)){
		int lx=pos[i],ly=gety(lx);
		int rx=pos[i+1],ry=gety(rx);
		int dx=(rx-lx)/cnt[i];
		int dy=(ly-ry)/cnt[i];
		int lw=0,up=x+y+1;
		while(up-lw>1){
			const int mid=(lw+up)/2;
			int p=fdiv(x-lx*mid,dx);
			int q=fdiv(y-ry*mid,dy);
			if(p>=0&&q>=0&&p+q>=cnt[i]*mid)
				lw=mid;
			else
				up=mid;
		}
		chmax(ans,lw);
	}
	print(ans);
}

