				ll lb = max(0LL, (1LL * mid * cur_y - Y + delta_y - 1) / delta_y), rb = min(1LL*mid*c, (X - 1LL * mid * cur_x) / delta_x);
				if (lb <= rb) {
					res = mid;
					L = mid + 1;
				} else R = mid - 1;
			}
			ans = max(ans, res);
			cur_x = nxt_x, cur_y = nxt_y;
		}
		printf("%d\n", ans);
	}
	return 0;
}

