}
void exgcd(ll a, ll b, ll& x, ll& y) {
  if (!b) {
    x = 1, y = 0;
  } else {
    exgcd(b, a % b, y, x);
    y -= (a / b) * x;
  }
}
ll inv(ll a, ll Mod) {
  ll x, y;
  exgcd(a, Mod, x, y);
  return x < 0 ? x + Mod : x;
} 

typedef class vec {
  public:
    ll dx, dy;
    int c;

    vec(ll dx, ll dy, int c) : dx(dx), dy(dy), c(c) { }
} vec;

int T;
ll A, X, B, Y, C;
vector<vec> conv;

void solve() {
  scanf("%lld%lld%lld%lld%lld", &A, &X, &B, &Y, &C);
  ll g = gcd(A, B), ga, gb;
  A /= g, B /= g, C /= gcd(g, C);
  ga = gcd(A, C);
  A /= ga, Y /= ga, C /= ga;
  gb = gcd(B, C);
  B /= gb, X /= gb, C /= gb;
  if (C == 1) {
    printf("%lld\n", X + Y);
    return;
  }

  conv.clear();
  ll W = C, H = A * inv(B, C) % C, x0 = 0, ia = inv(A, C), p = 0, np;
  while (W && H) {
    if (W >= H) {
      ll t = W / H;
      W -= t * H;
      x0 += t * H;
      np = x0 * B % C * ia % C;
      np += !np * C;
      conv.emplace_back((np - p) / t, H, t);
      p = np;
    } else {
      if (!(H % W)) { 
        conv.emplace_back(C - p, W, 1);
        break;
      } else {
        H %= W;
      }
    }
  }

  ll l = Y / C + 1, r = X + Y, mid;
  while (l <= r) {
    mid = (l + r) >> 1;
    ll ca = 0, cb = mid * C;
    for (auto v : conv) {
      ll ub = min((cb - Y - 1) / v.dy + 1, 1ll * v.c * mid);
      ub = min(ub, 1000000001ll);
      ca += v.dx * ub;
      cb -= v.dy * ub;
      if (ca > X || cb <= Y) {
        break;
      }
    }
    if (ca <= X && cb <= Y) {
      l = mid + 1;
    } else {
      r = mid - 1;
    }
  }
  printf("%d\n", l - 1);
}

