	{
		ll gabc = __gcd(c, __gcd(a, b));
		a /= gabc; b /= gabc; c /= gabc;
	}
	{
		ll ga = __gcd(c, a);
		y /= ga;
		b = (b * ga) % c;
		a /= ga; b /= ga; c /= ga;
	}
	{
		ll gb = __gcd(c, b);
		y /= gb;
		a = (a * gb) % c;
		a /= gb; b /= gb; c /= gb;
	}
	if(c == 1){
		cout << x + y << '\n';
		return;
	}
	assert(a > 0 && b > 0);
	ll r = (a * minv(b, c)) % c;
	assert(r > 0);
	if(r == 1){
		cout << (x + y) / c << '\n';
		return;
	}
	ll ir = minv(r, c);
	ll f = c - r * (c / r);
	ll g = c - ir * (c / ir);
	ll s = 0; // yes
	ll e = int(2e9) + 1;
	ll fx = c / r;
	ll fy = f;
	ll gx = g;
	ll gy = c / ir;
	assert(fx <= gx && fy >= gy);
	while(s + 1 < e){
		ll m = (s + e) / 2;
		ll na = m * fx;
		ll nb = m;
		ll nc = m * gy;
		ll dx = gx - fx;
		ll dy = gy - fy;

		ll curx = 0;
		ll cury = c;
		vector<pair<pair<ll,ll>, ll> > z = {{{r, 1}, na}, {{dx, dy}, nb}, {{1, ir}, nc}};
		for(auto q : z){
			if(cury > y){
				ll gg = (cury - y - 1) / q.first.second + 1;
				gg = min(g, q.second);
				curx += gg * q.first.second;
				cury -= gg * q.second;
			}
		}
		if(c <= x){
			s = m;
		} else {
			e = m;
		}
	}
	cout << s << '\n';
}

