int solve(int k, int p, int l, int r) {
    if (r >= l + p) r = l + p - 1;
    if (r >= p) {
        int x = (l + k - 1) / k;
        int res = solve(k, p, l - k * x, r - k * x);
        if (res == -1) return -1;
        return x + res;
    }
    k %= p;
    if (l <= -p) {
        int x = ((- p - l) / p) + 1;
        l += p * x, r += p * x;
    }
    if (!k) {
        if (l <= 0 && r >= 0)
            return 0;
        else 
            return -1;
    }
    int q = solve(p, k, -r, -l);
    if (q == -1) return -1;
    // ki >= l + qp
    int ret = max(0ll, (l + 1LL * q * p + k - 1) / k);
	if (k * ret > r + 1LL * q*p) {
		puts("???");
	}
	return ret;
}

