			if(AY*X<=AX*Y || BY*X>=BX*Y) continue;
			ll step=cand[i+1][2];
			ll g=__gcd(BX-AX,AY-BY);
			assert(g%step==0);
			ll dx=(BX-AX)/step;
			ll dy=(BY-AY)/step;

			int cur=0;
			for(j=29;j>=0;j--) if(cur+(1<<j)<step) {
				ll CX=AX+(cur+(1<<j))*dx;
				ll CY=AY+(cur+(1<<j))*dy;
				if(CY*X>CX*Y) cur+=1<<j;
			}
			ll TX=AX+cur*dx;
			ll TY=AY+cur*dy;
			ll SX=TX+dx;
			ll SY=TY+dy;
			//cout<<step<<endl;
			//cout<<"!"<<(TX*A+TY*B)%C<<endl;
			//cout<<"!"<<(SX*A+SY*B)%C<<endl;
			ret=max(ret,min(TX?(X/TX):(1<<30),TY?(Y/TY):(1<<30)));
			ret=max(ret,min(SX?(X/SX):(1<<30),SY?(Y/SY):(1<<30)));
			FOR(r,2) {
				ll mx=0;
				for(j=29;j>=0;j--) {
					__int128_t lef=(-TX*(mx+(1<<j))+X)*(__int128_t)SY;
					__int128_t ri=(-TY*(mx+(1<<j))+Y)*(__int128_t)SX;
					if(lef<ri) mx+=1<<j;
				}
				//cout<<i<<":: "<<SX<<" "<<SY<<" "<<TX<<" "<<TY<<" "<<X<<" "<<Y<<" "<<mx<<" "<<ret<<endl;
				for(ll x=max(0LL,mx-2);x<=mx+2;x++) if(x>=0) {
					ll LX=X-TX*x;
					ll LY=Y-TY*x;
					if(LX>=0&LY>=0) {
						ret=max(ret,x+min(SX?(LX/SX):(1<<30),SY?(LY/SY):(1<<30)));
						//cout<<x<<" "<<x+min(SX?(LX/SX):(1<<30),SY?(LY/SY):(1<<30))<<endl;
						ll y=min(SX?(LX/SX):(1<<30),SY?(LY/SY):(1<<30));
						ll XX=TX*x+SX*y;
						ll YY=TY*x+SY*y;
						//cout<<(X>=XX)<<" "<<(Y>=YY)<<" "<<x+y<<endl;
					}
				}
				//cout<<i<<":: "<<SX<<" "<<SY<<" "<<TX<<" "<<TY<<" "<<X<<" "<<Y<<" "<<mx<<" "<<ret<<endl;
				swap(TX,SY);
				swap(SX,TY);
				swap(X,Y);
			}
		}

		cout<<ret<<endl;


	}
}


