ll div(ll a, ll b, ll mod){ ///////////////////
	ll c=b, d=mod, u=1, v=0;
	while (d){
		ll t = c / d;
		c -= t * d; swap(c, d);
		u -= t * v; swap(u, v);
	}
	a = a * u % mod;
	if (a < 0) a += mod;
	return a;
}

void solve()
{
	ll A, X, B, Y, C;  cin >> A >> X >> B >> Y >> C;

	{
		ll g=Gcd(Gcd(A, B), C);
		A/=g;
		B/=g;
		C/=g;
	}
	ll a=gcd(A, C);
	ll b=gcd(B, C);
	ll x1=b;
	ll p=C/b-A;
	ll BB=B/b;
	ll CC=C/b;
	ll y1=div(p, BB, CC);

	ll x0=0;
	ll y0=CC;

	ll t;
	while (true){
		//(xe,ye)
		t=y0/(y0-y1);
		ll xe=x0+t*(x1-x0);
		ll ye=y0-t*(y0-y1);

		//(X,Y)break
		if (Y*xe>=X*ye) break;

		//(x0,y0),(x1,y1)
		ll xm=x0+(t-1)*(x1-x0);
		ll ym=y0-(t-1)*(y0-y1);
		x0=xe;
		y0=ye;
		ll k=CEIL(ym, y0);
		x1=x0*k-xm;
		y1=y0*k-ym;
	}

	// (x0,y0), (x1,y1), t

	//(X,Y)
	ll xp, yp, xq, yq;
	{
		ll ng=0;
		ll ok=t;
		while (abs(ng-ok)>1){
			ll m=(ng+ok)/2;
			ll xm=x0+m*(x1-x0);
			ll ym=y0-m*(y0-y1);
			if (Y*xm>=X*ym) ok=m; else ng=m;
		}
		xp=x0+ng*(x1-x0);
		yp=y0-ng*(y0-y1);
		xq=x0+ok*(x1-x0);
		yq=y0-ok*(y0-y1);
	}

	//(xp,yp),(xq,yq)
	ll ans=0;
	{
		ll ng=Y/yp+10;
		ll ok=0;
		while (abs(ng-ok)>1){
			ll m=(ng+ok)/2;
			ll xx=X-xp*m;
			ll yy=Y-yp*m;
			if (yy>=0 and xq*yy>=xx*yq) ok=m; else ng=m;
		}
		{
			ll xxx=X-xp*ok;
			//ll yyy=Y-yp*ok;
			ll qnm=xxx/xq;
			chmax(ans, ok+qnm);
		}
		{
			//ll xxx=X-xp*ng;
