ll calc(ll A, ll M, ll L, ll R) // minimum nonnegative integer x s.t. L <= Ax mod M <= R
{
	if (R==0) return M;
	if(L==0) return 0;
	if(2*A>M) { swap(L,R); A=M-A; L=M-L; R=M-R; }
	ll cc_1=ceil(L,A);
	if(A*cc_1<=R) return cc_1;
	ll cc_2=calc(A-M%A,A,L%A,R%A);
	return ceil(L+M*cc_2,A);
}

