		//(x0,y0),(x1,y1)
		ll xm=x0+(t-1)*(x1-x0);
		ll ym=y0-(t-1)*(y0-y1);
		x0=xe;
		y0=ye;
		ll k=CEIL(ym, y0);
		x1=x0*k-xm;
		y1=y0*k-ym;
	}

