			ll m=(ng+ok)/2;
			ll xm=x0+m*(x1-x0);
			ll ym=y0-m*(y0-y1);
			if (Y*xm>=X*ym) ok=m; else ng=m;
		}
		xp=x0+ng*(x1-x0);
		yp=y0-ng*(y0-y1);
		xq=x0+ok*(x1-x0);
		yq=y0-ok*(y0-y1);
	}

	//(xp,yp),(xq,yq)
