	{
		ll ng=Y/yp+10;
		ll ok=0;
		while (abs(ng-ok)>1){
			ll m=(ng+ok)/2;
			ll xx=X-xp*m;
			ll yy=Y-yp*m;
			if (yy>=0 and xq*yy>=xx*yq) ok=m; else ng=m;
		}
		{
			ll xxx=X-xp*ok;
			//ll yyy=Y-yp*ok;
			ll qnm=xxx/xq;
			chmax(ans, ok+qnm);
		}
		{
			//ll xxx=X-xp*ng;
			ll yyy=Y-yp*ng;
			if (yyy>0){
				ll qnm=yyy/yq;
				chmax(ans, ng+qnm);
			}
		}
	}
	cout << ans << '\n';
}

