ll div(ll a, ll b, ll mod){ ///////////////////
	ll c=b, d=mod, u=1, v=0;
	while (d){
		ll t = c / d;
		c -= t * d; swap(c, d);
		u -= t * v; swap(u, v);
	}
	a = a * u % mod;
	if (a < 0) a += mod;
	return a;
}

void solve()
{
	ll A, X, B, Y, C;  cin >> A >> X >> B >> Y >> C;

	{
