/**
 * Description: euclid finds ${x,y}$ such that $ax+by=\gcd(a,b)$ 
 	* and $|ax|,|by|\le \frac{ab}{\gcd(a,b)}.$ Should work for $a,b<2^{62}$
 * Source: KACTL
 * Time: O(\log ab)
 */

pl euclid(ll a, ll b) { 
	if (!b) return {1,0};
	pl p = euclid(b,a%b); return {p.s,p.f-a/b*p.s}; }
ll invGen(ll a, ll b) { 
	pl p = euclid(a,b); assert(p.f*a+p.s*b == 1); // gcd is 1
	return p.f+(p.f<0)*b; }

/**
 * Description: finds smallest $x\ge 0$ such that $L\le Ax\pmod{P}\le R$
 * Source: https://codeforces.com/gym/102411/submission/64315879
 * Verification: https://codeforces.com/gym/102411/problem/G
 */

ll cdiv(ll x, ll y) { return (x+y-1)/y; }
ll bet(ll P, ll A, ll L, ll R) { 
	if (A == 0) return L == 0 ? 0 : -1;
	ll c = cdiv(L,A); if (A*c <= R) return c;
	ll B = P%A; // P = k*A+B, L <= A(x-Ky)-By <= R 
	// => -R <= By % A <= -L
	auto y = bet(A,B,A-R%A,A-L%A); 
	return y == -1 ? y : cdiv(L+B*y,A)+P/A*y;
}


ll A,X,B,Y,C;
int solve() {
	re(A,X,B,Y,C);
	ll g = __gcd(A,B);
	A /= g, B /= g; C /= __gcd(g,C);
	F0R(i,2) {
		int t = __gcd(A,C);
		Y /= t; A /= t, C /= t;
		swap(A,B); swap(X,Y);
	}
	assert(__gcd(A,B) == 1 && __gcd(B,C) == 1 && __gcd(C,A) == 1);
	//dbg("OK",A,B,C,X,Y);
	if (C == 1) return X+Y;
	vpi posi; posi.pb({0,C});
	int con = -1LL*A*invGen(B,C)%C; con = (con+C)%C;
	//dbg("START LOOP");
	while (1) {
		int L = 1, R = posi.bk.s-1; if (L > R) break;
		ll x = bet(C,con,L,R); if (x == -1) break;
		posi.pb({x,con*x%C});
		//dbg("HAHA",posi.bk);
		// 0 < (-A*x)*B^{-1} < posi.bk.s mod C
	}
	//dbg("END LOOP");
	posi.pb({C,0});
	//dbg(posi);
	ll ans = 0;
	trav(t,posi) {
		ll mul = INF;
		if (t.f) ckmin(mul,X/t.f);
		if (t.s) ckmin(mul,Y/t.s);
		ckmax(ans,mul);
	}
	F0R(i,sz(posi)-1) {
		pi a = posi[i], b = posi[i+1];
		auto ok = [&](ll mid) -> bool {
			if (a.f*mid > X || b.s*mid > Y) return 0;
			ll L = 0, R = mid;
			if (b.f*mid > X) {
				// a.f*x+b.f*(mid-x) <= X
				// (a.f-b.f)*x+b.f*mid <= X
				// x*(b.f-a.f) >= b.f*mid-X
				L = cdiv(b.f*mid-X,b.f-a.f);
			}
			if (a.s*mid > Y) {
				// a.s*x+b.s*(mid-x) <= Y
				// (a.s-b.s)*x <= Y-b.s*mid
				R = (Y-b.s*mid)/(a.s-b.s);
			}
			return L <= R;
		};
		ll lo = 0, hi = X+Y;
		while (lo < hi) {
			ll mid = (lo+hi+1)/2;
			if (ok(mid)) lo = mid;
			else hi = mid-1;
		}
		ckmax(ans,lo);
	}
	// dbg("HA",posi);
	return ans;
	// Ax+By is divisible by C
	// what if gcd(A,C) > 1?
	// gcd(B,C) > 1?
}

