void solve() {
  scanf("%lld%lld%lld%lld%lld", &A, &X, &B, &Y, &C);
  ll g = gcd(A, B), ga, gb;
  A /= g, B /= g, C /= gcd(g, C);
  ga = gcd(A, C);
  A /= ga, Y /= ga, C /= ga;
  gb = gcd(B, C);
  B /= gb, X /= gb, C /= gb;
  if (C == 1) {
    printf("%lld\n", X + Y);
    return;
  }

  conv.clear();
  ll W = C, H = A * inv(B, C) % C, x0 = 0, ia = inv(A, C), p = 0, np;
  while (W && H) {
    if (W >= H) {
      ll t = W / H;
      W -= t * H;
      x0 += t * H;
      np = x0 * B % C * ia % C;
      np += !np * C;
      conv.emplace_back((np - p) / t, H, t);
      p = np;
    } else {
      if (!(H % W)) { 
        conv.emplace_back(C - p, W, 1);
        break;
      } else {
        H %= W;
      }
    }
  }

  int l = 1, r = X + Y, mid;
  while (l <= r) {
    mid = (l + r) >> 1;
    ll ca = 0, cb = mid * C;
    for (auto v : conv) {
