	return b?gcd(b,a%b):a;
}

int extgcd(int a,int b,int &x,int &y){
	int g=a;
	x=1;
	y=0;
	if(b!=0){
		g=extgcd(b,a%b,y,x);
		y-=(a/b)*x;
	}
	return g;
}
int inv(int a,int m){
	int x,k;
