ll inv(ll a, ll mod){
	ll b = mod, x = 0, y = 1, u = 1, v = 0;
	while(a){
		ll q = b / a, r = b % a;
		tie(x, y, u, v) = make_tuple(u, v, x - u * q, y - v * q);
		b = a, a = r;
	}
	return x + (x < 0) * mod;
}

ll a, x, b, y, c;
ll g, w, h, ia;
vector<pii> v;

bool works(ll f){
	ll l = 0, r = v.size();
	while(r - l > 1){
		ll mid = (l + r) / 2;
		if(f * (c - v[mid].s.s) >= y) l = mid;
		else r = mid;
	}
	if(l == v.size() - 1) return 0;

	ll dx = v[l + 1].s.f - v[l].s.f, dy = v[l + 1].s.s - v[l].s.s;
	dx /= v[l + 1].f, dy /= v[l + 1].f;

	return l < v.size() - 1 && f * v[l].s.f + 
		(f * (c - v[l].s.s) + dy - y - 1) / dy * dx <= x; 
}

void answer(){
	cin >> a >> x >> b >> y >> c;	

	g = __gcd(a, b);
	a /= g, b /= g, c /= __gcd(g, c);
	g = __gcd(a, c);
	a /= g, y /= g, c /= g;
	g = __gcd(b, c);
	b /= g, x /= g, c /= g;

	w = c, h = a * inv(b, c), ia = inv(a, c);
	v.assign(1, {1, {0, 0}});
	while(w && h){
		if(w >= h){
			ll t = w / h;
			w -= t * h;
			v.push_back({t, {(c - w) * b % c * ia % c, c - w}});
		}else if(h % w){
			h %= w;
		}else{
			v.push_back({1, {c, c}});
			break;
		}
	}

	ll l = y / c, r = x + y + 1;
	while(r - l > 1){
		ll mid = (l + r) / 2;
		if(works(mid)) l = mid;
		else r = mid;
	}

	cout << l << endl;
}

